Antrąją vietą užėmė šeimininkų atstovas Bjarni Nielsenas (47,5 tšk.), trečiąją - danas Olė Martenas Hansenas (45,5 tšk.). Vienas varžybų favoritų britas Laurence'as Shahlaei patyrė traumą ir su 10 taškų liko paskutinis - septintas. Triumfas Farerų Salose Ž. Savickui tapo paguoda po nepatekimo į kitų metų kovo mėnesį JAV vyksiantį prestižinį „ Arnold Strongman Classic “ turnyrą. Tituluoto lietuvio nėra paskelbtame 10 dalyvių sąraše. Kelialapius į šį turnyrą buvo galima iškovoti dalyvaujant „Arnold Classic“ varžybų etapuose Europoje, Australijoje, Afrikoje ir Pietų Amerikoje. Teisę dalyvauti finalinėse varžybose iškovojo amerikiečiai Brianas Shaw ir Jerry Prichettas, rusas Michaelas Šivliakovas, estas Raunas Heinla, lenkai Mateušas Keliskovskis ir Mateušas Ostaževskis, islandas Hafthoras Bjornssonas, slovėnas Matjažas Belšakas, kanadietis Jeanas-Francois Caronas ir bulgaras Dimitaras Savatinovas. Pirmas tarp rezervinių sportininkų yra 35-erių metų lietuvis  Vytautas Lalas . Jis varžybose dalyvautų jei bent vienas iš minėtų galiūnų to padaryti negalėtų. Ž. Savickas šias varžybas yra laimėjęs net aštuonis kartus - 2003-2008, 2014 ir 2016 metais. Šiais metais Ž. Savickas turnyrą praleido dėl traumos. V. Lalas šiose varžybose triumfavo 2013 metais. (function(d, s, i, r) {
